import Navbar from '../Navbar/Navbar';
import './Header.css';
import logos from '../../../images/logos/logos.png';

const Header = () => {
    return (
        <div className="header-container">
            <Navbar></Navbar>
            <div class="container d-flex justify-content-center mt-5">
                <div class="col-md-5 pt-5">
                    <h1 class="font-weight-bold">Let's Grow Your Brand To The Next Level</h1>
                    <p class="text-dark mt-3">Lorem ipsum dolor sit amet consectetur adipisicing elit. Recusandae
                    nemo doloremque quibusdam
                   sit odit?</p>
                    <button class="brand-color text-white mt-2">Get Started</button>
                </div>
                <div class="col-md-7 ">
                    <img class="img-fluid" src={logos} alt="" />
                </div>
            </div>
        </div>
    );
};

export default Header;
